EXECUTE IMMEDIATE $$
DECLARE
  v_id INT;
  v_name STRING;
BEGIN
  SELECT 1, 'Alice'
  INTO :v_id, :v_name;
  RETURN v_id || ' ' || v_name;
END;
$$;

