WITH TEMP_TABLE AS (
    SELECT column1
    FROM (VALUES (0), (1), (-2), (3.5), (-4.5), (NULL)) AS TEMP(column1)
)
SELECT column1, abs(column1)
FROM TEMP_TABLE;

WITH basic_example(i_col, j_col) AS (
    SELECT * FROM VALUES
        (11, 101), (11, 102), (11, NULL), (12, 101), (NULL, 101), (NULL, 102)
)
SELECT COUNT_IF(TRUE) FROM basic_example;

WITH basic_example(i_col, j_col) AS (
    SELECT * FROM VALUES
        (11, 101), (11, 102), (11, NULL), (12, 101), (NULL, 101), (NULL, 102)
)
SELECT COUNT_IF(j_col > i_col) FROM basic_example;

WITH basic_example(i_col, j_col) AS (
    SELECT * FROM VALUES
        (11, 101), (11, 102), (11, NULL), (12, 101), (NULL, 101), (NULL, 102)
)
SELECT COUNT_IF(i_col IS NOT NULL AND j_col IS NOT NULL) FROM basic_example;

WITH TEMP_TABLE AS (
    SELECT DATE '2025-05-01' AS "Today's Date"
)
SELECT "Today's Date",
       PREVIOUS_DAY("Today's Date", 'Friday ') AS "Previous Friday"
FROM TEMP_TABLE;

WITH TEMP_TABLE AS (
  SELECT column1 
  FROM VALUES (1), (null), (5), (0), (3.14159)
)
SELECT column1, ZEROIFNULL(column1) 
FROM TEMP_TABLE;
